import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";

ReactDOM.render(

    <React.Fragment>
        <Heading/>
        <p>List of cities:</p>
        <ol>
            <li>Hyderabad</li>
            <li>Delhi</li>
            <li>Mumbai</li>
            <li>Chennai</li>
        </ol>

    </React.Fragment>
    ,document.getElementById('root')
);
